@-moz-document domain("127.0.0.1"), /*[[apptv]]*/ url-prefix("https://plex.tv"), regexp("https?://.*:32400/.*"), regexp(".*:32400/.*")
{
    /* Random Radio Station Covers */
    div[data-qa-id="metadataPosterCard--/library/sections/6/stations/1"] > div {
        background-image: url(https://images.unsplash.com/photo-1484704849700-f032a568e944?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=200&ixid=eyJhcHBfaWQiOjF9&ixlib=rb-1.2.1&q=80&w=200) !important;
        background-size: cover;
        background-position: center;
        background-blend-mode: multiply;
    }
    div[data-qa-id="metadataPosterCard--/library/sections/6/stations/2"] > div {
        background-image: url(https://images.unsplash.com/photo-1470225620780-dba8ba36b745?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=200&ixid=eyJhcHBfaWQiOjF9&ixlib=rb-1.2.1&q=80&w=200) !important;
        background-size: cover;
        background-position: center;
        background-blend-mode: multiply;
    }
    div[data-qa-id="metadataPosterCard--/library/sections/6/stations/3"] > div {
        background-image: url(https://images.unsplash.com/photo-1492560704044-e15259ca1c61?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=200&ixid=eyJhcHBfaWQiOjF9&ixlib=rb-1.2.1&q=80&w=200)!important;
        background-size: cover;
        background-position: center;
        background-blend-mode: multiply;
    }
  
    /* Dark Side Bar */
    div[class^="SourceSidebar-sidebar-"] {
        background-color: #101010 !important;
    }
  
    /* CARD HOVER EFFECTS */
    div[class^="MetadataPhotoCell-photoContainer-"]:hover div {
        transform: scale(1) !important;
        box-shadow: none !important; 
    }
    div[class^="MetadataPhotoCell-photoContainer-"]:hover > div:first-child {
        outline: 2px solid #cc7b19 !important;
    }
  
    div[class^="MetadataPosterCard-card-"] {
        -webkit-perspective: 500px;
        perspective: 500px;
        box-shadow: 0px 5px 12px -4px #101010;
        transition: all 350ms;
    }
  
    .MetadataPosterCell-titleContainer-24DI63 {
        position: absolute;
        width: 100%;
        bottom: 0;
    }
    
    div[class^="MetadataPosterCard-card-"]:hover {
        transform: scale(0.95) translateY(0px);
        box-shadow: 0px 0px 0px 0px #000;
    }
  
    /* Dark Search Box */
    .QuickSearchInput-focused-3rEqJC {
        background: rgba(0,0,0,0.5)  !important;
        color: #daa520 !important;
    }
    
    .QuickSearchInput-focused-3rEqJC input {
        color: #daa520 !important;
    }
  
    /* CAST MEMBERS HOVER EFFECT */
    a[class^="PrePlayCastCell-cardLink-"] {
        box-shadow: 0px 8px 15px -5px #000 !important;
    }
    a[class^="PrePlayCastCell-cardLink-"]:hover {
        animation: bulge 0.5s ease-in !important;
        box-shadow: none;
    }

    /* Now Playing Glyph */
    .NavBarActivityButton-isHighlighted-27qlko {
        animation: bulge 2s ease infinite !important;
    }
    
    /* FULLSCREEN BACKGROUND IMAGES */
    div[class^="PrePlayMetadataInnerContent-innerContent-"] {
        filter: opacity(1) !important;
    }
  
    div[class="PageContent-innerPageContent-3ktLTA"] > div > div:not(.PrePlayMetadataContent-content-2ww3jI) {
        position: sticky !important;
        top: 60px !important;
        height: auto !important;
    }
  
   .PrePlayPageContent-prePlayPageContent-2WcFUT .MetadataPosterCard-cardContainer-2gRcQF {
       float: left;
   }
  
    div[class="PrePlayArtwork-imageContainer-3dXG6V CrossFadeImage-crossFade-10Sndv"] {
        width: 100%;
        height: 100vh !important;
        background-size: cover;
        background-position: center top;
        background-repeat: no-repeat;
        filter: saturate(/*[[saturate]]*/) blur(/*[[blur]]*/px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        background-blend-mode: multiply !important;
        animation: /*[[kenburns]]*/ !important;
        animation-duration: 60s !important;
    }
  
    div[class^="AudioVideoFullMusic-card-"] > div > div:first-child > div {
        box-shadow: 0px 10px 20px -3px #000 !important;
        outline: 5px solid #fff !important;
        transition: all 350ms;
    }
  
    div[class^="AudioVideoFullMusic-card-"] > div:hover > div:first-child > div {
        box-shadow: 0px 0px 0px 0px #000 !important;
        outline: 5px solid orange !important;
    }
    
    /* Shadow on Fullplayer toolbar */
    .AudioVideoFullPlayer-topBar-2XUGMf:hover {
        background: rgba(0,0,0,0.35);
        box-shadow: 0px -3px 8px 1px #000;
    }
    
    /* Fullplayer toolbar : Click anywhere to minimize */
    button[data-qa-id="minimizePlayerButton"] {
        width: calc(100vw - 10vw);
        padding-left: 1em;
        text-align: left;
        float: left;
        height: 60px;
    }
    
    /* ANIMATIONS */
    @keyframes bgblur {
        0% {
            filter: blur(55px) opacity(0.45) brightness(0.6) sepia(0.25);
        }
        80% {
            filter: blur(25px) opacity(0.5) brightness(0.65) sepia(0.20);
        }
        100% {
            filter: blur(1.5px) opacity(0.55) brightness(0.7) sepia(0.15);
        }
    }
  
    @keyframes pulsate {
        0% {
            -webkit-transform: scale(1.7, 1);
            opacity: 1.0;
        }
        50% {
            -webkit-transform: scale(0.85, 0.85);
            opacity: 0.3;
        }
        100% {
            -webkit-transform: scale(1.7, 1);
            opacity: 1.0;
        }
    }

    @keyframes move {
        0% {
            transform: scale3d(1.2, 1.2, 1.2) translate3d(0px, 0px, 0px);
            filter: saturate(/*[[saturate]]*/) blur(3px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        }
        25% {
            transform: scale3d(1.3, 1.3, 1.3) translate3d(-12px, -9px, 0px);
            filter: saturate(/*[[saturate]]*/) blur(2px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        }
        50% {
            transform: scale3d(1.35, 1.35, 1.35) translate3d(0px, 12px, 0px);
            filter: saturate(/*[[saturate]]*/) blur(0px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        }
        80% {
            transform: scale3d(1.32, 1.32, 1.32) translate3d(7px, 5px, 0px);
            filter: saturate(/*[[saturate]]*/) blur(1px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        }
        100% {
            transform: scale3d(1.2, 1.2, 1.2) translate3d(0px, 0px, 0px);
            filter: saturate(/*[[saturate]]*/) blur(3px) opacity(/*[[opacity]]*/) brightness(/*[[bright]]*/) contrast(/*[[contrast]]*/) sepia(/*[[sepia]]*/) grayscale(/*[[gray]]*/);
        }
    }

    @keyframes squash {
        0%, 100% {
            transform-origin: 50% 100%;
        }
        0% {
            transform: translate(0%, 0%) scaleX(0.95) scaleY(1.05);
            opacity: 0;
        }
        11% {
            transform: translate(0%, 0%) scaleX(0.91) scaleY(1.09);
            opacity: .1;
        }
        30% {
            transform: translate(0%, 8%) scaleX(0.85) scaleY(1.15);
            opacity: 1;
        }
        35% {
            transform: translate(0%, 0%) scaleX(1.05) scaleY(0.95);
        }
        46% {
            transform: translate(0%, 2%) scaleX(1.20) scaleY(0.70);
        }
        54% {
            transform: translate(0%, 0%) scaleX(0.90) scaleY(1.10);
        }
        66% {
            transform: translate(0%, 0%) scaleX(1.10) scaleY(0.90);
        }
        78% {
            transform: translate(0%, 0%) scaleX(0.95) scaleY(1.05);
        }
        100% {
            transform: inherit;
        }
    }

    @keyframes flip {
        0% {
            transform: rotateY(0deg) scale(1);
            opacity: 1;
        }
        50% {
            transform: rotateY(90deg) scale(0.95);
            opacity: 0.35;
        }
        100% {
            transform: rotateY(0deg) scale(1);
            opacity: 1;
        }
    }

    @keyframes drop {
        0% {
            top: -100px;
        }
        100% {
            top: 0px;
        }
    }

    @keyframes bulge {
        0% {
            transform: scale(1);
        }
        50% {
            transform: scale(0.9);
        }
        100% {
            transform: scale(1);
        }
    }
  
    @keyframes bulge2 {
        0% {
            transform: scale(1);
        }
        50% {
            transform: scale(1.03);
        }
        100% {
            transform: scale(1);
        }
    }

    @keyframes zoom {
        0% {
            transform: scale3d(1, 1, 1) translate3d(0px, 0px, 0px);
        }
        10% {
            transform: scale3d(1.2, 1.2, 1.2) translate3d(0px, 0px, 0px);
        }
        25% {
            transform: scale3d(1.3, 1.3, 1.3) translate3d(-12px, -9px, 0px);
        }
        50% {
            transform: scale3d(1.35, 1.35, 1.35) translate3d(0px, 12px, 0px);
        }
        75% {
            transform: scale3d(1.32, 1.32, 1.32) translate3d(7px, 5px, 0px);
        }
        90% {
            transform: scale3d(1.2, 1.2, 1.2) translate3d(0px, 0px, 0px);
        }
        100% {
            transform: scale3d(1.2, 1.2, 1.2) translate3d(0px, 0px, 0px);
        }
    }
  
    .AudioVideoFullPlayer-fullPlayer-3bJyOR:not(.AudioVideoFullPlayer-isVideo-1aASwH) .FullPlayerBackground-backgroundContainer-2UnXoW > div > div + div {
        image-rendering: auto;
        background-color: #353535;
        background-size: cover !important;
        background-repeat: no-repeat;
        background-position: center center;
        transform: scale(1.01);
        filter: blur(2px) grayscale(0.5) contrast(1.05) brightness(0.6) invert(0.03) !important;
        background-image: /*[[musicbg]]*/ !important;
    }
  
     .FullPlayerBackground-backgroundContainer-2UnXoW > div > div + div {
         filter: blur(2px) grayscale(0.5) contrast(1.03) brightness(0.7) invert(0.03) !important;
     }
  
     .background-container > .FullPage-container-17Y0cs > div > div > div,
     .FullPlayerBackground-backgroundContainer-2UnXoW > div > div + div {
        image-rendering: auto;
        background-color: #353535;
        background-size: auto, cover !important;
        background-repeat: repeat, no-repeat !important;
        background-position: center center !important;
        background-attachment: fixed;
        /*background-blend-mode: multiply !important;*/
        /* YouTube Leanback: Radial Gradient */
        background-image: 
          url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAKCAYAAACNMs+9AAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAADxJREFUeNpi5JWyYiACqDERowiIbzERowjEYCJGET6FKIpwKcRQhE0hVkXoCnEqQlaIVxFMIUFFIAAQYABFtgmb+NIRGwAAAABJRU5ErkJggg=='),
          url('data:image/png;base64,') !important;
    }
}
